$("#status-button").click((function(){var t=$(this).data("user").split(",");t[1],$("#status-dialog").dialog({modal:!0,buttons:{Save:function(){var s=$("#status-select").val();s!==t[1]&&$.ajax({url:"/changeUserStatus",type:"POST",data:{userId:t[0],status:s},success:function(t){console.log("Статус успешно изменен")},error:function(t){console.error("Ошибка при изменении статуса: ",t)}}),$(this).dialog("close")},Cancel:function(){$(this).dialog("close")}}})}));